def _maybe_empty_lines(self, current_line: Line) -> Tuple[int, int]:
    max_allowed = 1
    if current_line.depth == 0:
        max_allowed = 2

    if current_line.leaves:
        first_leaf = current_line.leaves[0]
        before = min(first_leaf.prefix.count("\n"), max_allowed)
        first_leaf.prefix = ""
    else:
        before = 0

    depth = current_line.depth

    if any([
        current_line.is_decorator or current_line.is_def or current_line.is_class,
        current_line.is_flow_control,
        (self.previous_line and self.previous_line.is_import and not current_line.is_import and depth == self.previous_line.depth),
        (self.previous_line and self.previous_line.is_yield and (not current_line.is_yield or depth != self.previous_line.depth))
    ]):
        if not current_line.is_decorator:
            self.previous_defs.append(depth)

    if self.previous_line is None:
        return 0, 0

    if current_line.is_decorator and self.previous_line.is_decorator:
        return 0, 0

    if current_line.depth:
        return 1, 0

    return 2, 0
